const Alarm = () => {
    return (
        <div className='container w-1/2 h-1/2 bg-slate-800 rounded-md flex flex-col justify-center items-center'>
            <div className='text-white font-bold text-4xl'>23:53:04</div>
            <div className='inputs mt-5'>
                <input type='number' className='mr-7' placeholder='00' min={0} max={23}></input>
                <input type='number' placeholder='00' min={0} max={59}></input>
            </div>
            <div className='buttons w-1/2'>
                <button type='number' className='mr-2' placeholder='00' min={0} max={23}>Add</button>
                <button type='number' placeholder='00' min={0} max={59}>Clear</button>
            </div>
        </div>
    );
};

export default Alarm;
